import React, { Component } from 'react';
import BasePageWithCard from '../pages/BasePages/BasePageWithCard';
import EditThemeListTeacherForm from '../components/Tables/EditThemeList/EditThemeListTeacherForm.js';

const EditThemeListTeacher = ({ tableData, teacherData}) => {
  
    return (
        <BasePageWithCard isAuthenticated={true} data={teacherData}>
          <EditThemeListTeacherForm tableData={tableData}/>
          </BasePageWithCard>
      );
    

}
export default EditThemeListTeacher;
